import React from "react";
import "./Homepage.css";
function Homepage(){
    return <>
        <div className="homepage">
            <h2>Welcome To</h2>
            <h1>Quizzz</h1>
            <button className="homepage-loginbtn">Login</button>
            <button className="homepage">Register</button>
        </div>
    </>
}

export default Homepage;
